import React from 'react';

class NAVBAR extends React.Component {
  render() {
    return (
      <header>
        <div className='bg-black fixed w-full h-11 items-center grid grid-cols-1 md:grid-cols-2'>
          <div className='flex justify-center items-center'><a className='bg-red-600' href="/">Home</a></div>
          <div className='items-center justify-end right-5 flex lg:hidden border'>
          <nav className=''>
            <button className='translate-y-1 top-2'>
              <div className='bg-white mb-1.5 w-7 h-1 rounded-md'></div>
              <div className='bg-white mb-1.5 w-7 h-1 rounded-md'></div>
              <div className='bg-white w-7 h-1 rounded-md'></div>
            </button>
          </nav>
          </div>
        </div>
      </header>
    );
  }
}

function App() {
  return (
    <div className="App">
      <NAVBAR />
    </div>
  );
}

export default App;
